  // *** Filter by City ***
  const cityFilter = document.querySelector("#filterOptions");
  cityFilter.addEventListener("change", filterHandler);

  // *** Delete contacts ***
  // Select all of 'main' to simultaneously select all the buttons inside of it
  const main = document.querySelector("main");
  // add an event listener to all of main
